5 and a half years ago we launched Mag St Bread Co as a B2B brand supplying breads to cafes and restaurants across the city. The pandemic changed everything. With restaurants closed, our business transitioned overnight into a B2C brand. Up until now we had never thought about our packaging seriously. 

The lockdown meant that we were limited with what was available to use as packaging. We didn’t have a choice so went ahead with what we could get but that meant grease stains on brown bags, handwritten labels sometimes with incorrect spellings, excessive cellotape, and the list goes on - simply put, packaging that was not in sync with the quality of product we were producing.

Fast forward 6 months - things opened up so we decided it was time to focus on our packaging - we wanted it to be as sustainable as possible, and as much of a hero as our product. After all, packaging is integral to a brand story - it’s one of the first touchpoints for a consumer. 

Thank you to everyone who helped us get this in place:
@matchstickconnect for giving our packaging a major face lift and making our vision a reality.

@fatehgrapher for making our packaging imagery look so real. 

@rheeses13 and @kulesushant_33 for working tirelessly with Excellent Printers who delivered to us in time to hit the shelves at @magstreetcafe 

